function Navbar() {
    function handleClick(e) {
        e.preventDefault();
        console.log('You clicked submit.');
    }

    return (
        <nav className="navbar" onClick={handleClick}>
          <h1 draggable="false">Receptionist Tab</h1>
        </nav>
    );
}
   
export default Navbar;
